import { Routes, Route, Link } from "react-router-dom";
import Header from "../components/Header";


const Inscription =()=> {
    return ( 
        
        <div className="inscription">
             <Header prop={ [<Link to="/connexion">Connexion</Link>,
             <Link to="/">Accueil</Link>]}/>
            <h1>Inscription</h1>
        </div>
     );
}

export default Inscription ;
